import "./App.css";
import Navbar from "./Navbar.js";
import Hero from "./Hero.js";
import Card from "./Card.js";
function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <Card
        img="./katie-zaferes.png"
        rating="5.0"
        reviewCount={6}
        country="USA"
        title="Life lessons by katie"
        price={136}
      />
    </div>
  );
}

export default App;
